    false,nt"url": null,nt"notes": "This study was conducted in June 1987 on
    Adak Island, Alaska, at two sites in the Clam Lagoon area. The primary objectives
    of the Aleutian tern (Sterna aleutica) study were to delineate colony boundaries,
    determine the population size of the colony, determine activity periods and nesting
    phenology, develop methods that can be repeated in future years and record all abnormal
    disturbances. The Aleutian tern is a summer visitor to Adak Island, arriving in
    late May and departing in mid to late August.",nt"license_title": "License
